// Export View SignIn
export default function SignInRegister() {

 const [people, setPleople] = React.useState();
 const user = auth.currentUser;
 React.useEffect(() => {
  setPleople(user);
 }, []);

 return (
  <ReturnSignInRegister />
 );
};
